import React from "react";

export default function PerguntaOpcoes(props) {
  return (
    <div>
      <p>{props.pergunta}</p>
      <select>
        {props.opcoes.map(opcao => (
          <option value={opcao}>{opcao}</option>
        ))}
      </select>
    </div>
  );
}
